import React from "react";

// Import images
import armbruster from "./staffimages/armbruster.avif";
import casey from "./staffimages/casey.avif";
import garner from "./staffimages/garner.avif";
import goulart from "./staffimages/goulart.avif";
import hendersen from "./staffimages/hendersen.avif";
import ladikos from "./staffimages/ladikos.avif";
import lemich from "./staffimages/lemich.avif";
import lindelof from "./staffimages/Lindelof.avif";
import little from "./staffimages/litle.avif";
import mcnair from "./staffimages/mcnair.avif";
import meltesen from "./staffimages/meltesen.avif";
import moghaddam from "./staffimages/moghaddam.avif";
import murdock from "./staffimages/murdock.avif";
import perez from "./staffimages/Perez.avif";
import reike from "./staffimages/reike.avif";
import rominger from "./staffimages/Rominger.avif";
import stone from "./staffimages/stone.avif";
import templeton from "./staffimages/templeton.avif";

// Map of images by last name
const images = {
  armbruster,
  casey,
  garner,
  goulart,
  hendersen,
  ladikos,
  lemich,
  lindelof,
  little,
  mcnair,
  meltesen,
  moghaddam,
  murdock,
  perez,
  reike,
  rominger,
  stone,
  templeton,
};

function OurTeam() {
  const team = [
    {
      name: "Gregory C. Lemich, Ph.D., LPC",
      role: "Owner and Clinical Director",
      description: "Founder of the Lemich Clinic...",
      lastName: "lemich",
      specialties: "",
      availability: "",
    },
    {
      name: "Kezia McNair, MSeD, Resident in Counseling (VA)",
      role: "Clinician",
      description: "8 years experience with the Department of Veteran Services...",
      lastName: "mcnair",
      specialties: "",
      availability: "In-Person and Telehealth",
    },
    {
      name: "Anthony Ladikos, MSeD, Resident in Counseling (VA)",
      role: "Clinician",
      description: "Specializes in Integrated and Trauma-Informed CBT...",
      lastName: "ladikos",
      specialties: "Integrated and Trauma-Informed CBT",
      availability: "In-Person and Telehealth",
    },
    {
      name: "Lauren Murdock, MSeD, Resident in Counseling (VA)",
      role: "Clinician",
      description: "Navy veteran spouse, specializes in military stress...",
      lastName: "murdock",
      specialties: "",
      availability: "Telehealth",
    },
    {
      name: "Sarah Rieke, MSeD, Resident in Counseling (VA)",
      role: "Clinician",
      description: "Wide range of clinical experience including EMDR...",
      lastName: "reike",
      specialties: "EMDR",
      availability: "In-Person and Telehealth",
    },
    {
      name: "Kiana Dabier Moghaddam, MSeD, Resident in Counseling (VA)",
      role: "Clinician",
      description: "Specializes in refugee and immigrant resettlement...",
      lastName: "moghaddam",
      specialties: "EMDR",
      availability: "Telehealth",
    },
    {
      name: "Elena Little, MSeD, Resident in Counseling (VA)",
      role: "Clinician",
      description: "Focuses on trauma-informed care and dual diagnosis...",
      lastName: "little",
      specialties: "EMDR",
      availability: "In-Person and Telehealth",
    },
    {
      name: "Robert Armbruster (Robie), MSeD, Resident in Counseling (VA)",
      role: "Clinician",
      description: "Aids couples recovering from betrayal trauma...",
      lastName: "armbruster",
      specialties: "EMDR, Grief-Informed Counseling, Complex Trauma, Addiction",
      availability: "In-Person and Telehealth",
    },
    {
      name: "Ashley Casey, MSeD, Resident in Counseling (VA)",
      role: "Clinician",
      description: "Focuses on relationship issues and gender dysphoria...",
      lastName: "casey",
      specialties: "ACT",
      availability: "In-Person and Telehealth",
    },
    {
      name: "Hayli Stone, MSeD, Resident in Counseling (VA)",
      role: "Clinician",
      description: "Experience in anxiety, depression, and LGBTQ affirming care...",
      lastName: "stone",
      specialties: "EMDR",
      availability: "In-Person and Telehealth",
    },
    {
      name: "Crystal Goulart, Intern in Counseling (VA)",
      role: "Intern",
      description: "Specializes in trauma and life transitions...",
      lastName: "goulart",
      specialties: "",
      availability: "In-Person and Telehealth",
    },
    {
      name: "Morgan Templeton, Intern in Counseling (VA)",
      role: "Intern",
      description: "Focuses on creating safe and trusting environments...",
      lastName: "templeton",
      specialties: "",
      availability: "In-Person and Telehealth",
    },
    {
      name: "Amy Garner, Intern in Counseling (VA)",
      role: "Intern",
      description: "Specializes in military transitions and grief...",
      lastName: "garner",
      specialties: "",
      availability: "In-Person and Telehealth",
    },
    {
      name: "Amanda Hendersen, Intern in Counseling (VA)",
      role: "Intern",
      description: "Extensive knowledge of military culture and trauma...",
      lastName: "hendersen",
      specialties: "",
      availability: "In-Person and Telehealth",
    },
    {
      name: "Karen Rominger",
      role: "Case Manager and Office Coordinator",
      description: "Ensures clients have access to necessary resources...",
      lastName: "rominger",
      specialties: "Billing, Scheduling, Military Resources",
      availability: "",
    },
    {
      name: "Kalyn Lindelof",
      role: "Psych Tech and Assistant Office Coordinator",
      description: "Handles assessments, onboarding, and scheduling...",
      lastName: "lindelof",
      specialties: "Assessments, Scheduling, Onboarding",
      availability: "",
    },
    {
      name: "Maggie Perez",
      role: "Assistant Office Coordinator",
      description: "Supports military families with scheduling and resources...",
      lastName: "perez",
      specialties: "Resources, Scheduling, Onboarding, Assessments",
      availability: "",
    },
  ];

  return (
    <div className="bg-gray-50 py-12">
      <div className="container mx-auto px-4">
        <h2 className="text-3xl font-bold text-center text-gray-800 mb-8">
          Meet Our Team
        </h2>
        <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-8">
          {team.map((member, index) => (
            <div
              key={index}
              className="bg-white rounded-lg shadow-lg p-6 text-center"
            >
              <div className="mb-4">
                <div className="w-40 h-40 mx-auto rounded-full bg-gray-200">
                  <img
                    src={images[member.lastName]}
                    alt={`${member.name} photo`}
                    className="w-full h-full object-cover rounded-full"
                  />
                </div>
              </div>
              <h3 className="text-lg font-bold text-gray-800">{member.name}</h3>
              <p className="text-sm text-gray-500">{member.role}</p>
              <p className="text-sm text-gray-700 mt-2">{member.description}</p>
              {member.specialties && (
                <p className="text-sm text-gray-600 mt-2">
                  <span className="font-bold">Specialties: </span>
                  {member.specialties}
                </p>
              )}
              {member.availability && (
                <p className="text-sm text-gray-600 mt-2">
                  <span className="font-bold">Availability: </span>
                  {member.availability}
                </p>
              )}
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default OurTeam;
